mapper.select:
select 'true' as QUERYID,

from oss_sysmanage_oilin
where OilCanNo = #{oilcanno,jdbcType=INTEGER}
  and StartDate = #{startdate,jdbcType=VARCHAR}
  and StartTime = #{starttime,jdbcType=VARCHAR}

mapper.delete:
delete from oss_sysmanage_oilin
where OilCanNo = #{oilcanno,jdbcType=INTEGER}
  and StartDate = #{startdate,jdbcType=VARCHAR}
  and StartTime = #{starttime,jdbcType=VARCHAR}
